INSERT INTO `#__ak_storage`  VALUES ('liveupdate', '2017-06-21 07:15:10', '{\"stuck\":0,\"software\":\"Akeeba Backup for WordPress\",\"version\":\"2.2.0\",\"link\":\"http:\\/\\/cdn.akeebabackup.com\\/downloads\\/backupwp\\/2.2.0\\/akeebabackupwp-2.2.0-core.zip\",\"date\":\"2017-05-18\",\"releasenotes\":\"<h3>What\'s new<\\/h3><p>    <strong>Improved WordPress restoration<\\/strong>. More restoration cases for multisite installations are now    supported, including moving a directory-based multisite installation to a different folder.<\\/p><p>    <strong>More stable<\\/strong>.<\\/p><p>    <strong>Bug fixes<\\/strong>. We fixed several issues affecting backups under rather uncommon conditions.<\\/p><h3>Updating Akeeba Solo to version 2.2.0 or later<\\/h3><p>    A bug in the updater in version 2.1.0.b1 through 2.1.2 makes it impossible to update to the new version using the    built-in updater. You will have to do that manually.<\\/p><p>    <strong>Heads up!<\\/strong> You must NOT uninstall Akeeba Solo before the update. Doing so may result in loss of your    backup settings and \\/ or your backup archives. Instead, here\'s what to do:<\\/p><ul>    <li>        Download the ZIP file for Akeeba Solo and extract it locally.    <\\/li>    <li>        Upload all the files from the extracted archive into the folder on your site where Akeeba Solo is installed, using FTP or SFTP, overwriting your existing files.    <\\/li>    <li>        Log in to Akeeba Solo to automatically complete the update process. There is no message when the process completes. You just see the main page of Akeeba Solo (this means the update succeeded).    <\\/li><\\/ul><p>    You will only need to do this once, upgrading to version 2.2.0 or later for the first time.<\\/p><h3>Updating Akeeba Backup for WordPress to version 2.2.0 or later<\\/h3><p>    Due to changes in the packaging format and \\/ or issues in the updater, you cannot update automatically from Akeeba    Backup for WordPress versions 1.0 through 1.8.2 (inclusive) and versions 2.1.0.b1 through 2.1.2. You will have to do    that manually.<\\/p><p>    <strong>Heads up!<\\/strong> You must NOT uninstall or deactivate the plugin before the update. Doing so may result in    loss of your backup settings and \\/ or your backup archives. Instead, here\'s what to do:<\\/p><ul>    <li>        Download the ZIP file for Akeeba Backup for WordPress and extract it locally. You will see an extracted        folder named <code>akeebabackupwp<\\/code>.    <\\/li>    <li>        Upload the files from the extracted <code>akeebabackupwp<\\/code> folder into your site\'s        <code>wp-content\\/plugins\\/akeebabackupwp<\\/code>        folder, overwriting your existing files, using FTP or SFTP.        Please note that the name of the folder on your site <em>may<\\/em> be different than <code>akeebabackupwp<\\/code>,        e.g. <code>akeebabackupwpcore<\\/code>, <code>akeebabackupwp (1)<\\/code> or something similar. It depends on how        you installed the plugin.    <\\/li>    <li>        Log in to WordPress\' wp-admin and access Akeeba Backup for WordPress to automatically complete the update        process. There is no message when the process completes. You just see the main page of Akeeba Backup for        WordPress (this means the update succeeded).    <\\/li><\\/ul><p>    You will only need to do this once, upgrading to version 2.2.0 or later for the first time.<\\/p><h3>PHP 5.3.4 or later (incl. 5.4, 5.5, 5.6) or PHP 7 is required<\\/h3><p>    Akeeba Solo and Akeeba Backup for WordPress are compatible with PHP 5.3.04 and later versions, including 5.4,    5.5, 5.6 and the newest versions of PHP, 7.0 and 7.1.    We\'d like to remind you that this requirement refers only to our software. The sites which can be backed up by our    software may not support all of the aforementioned PHP versions. Please check the requirements of your site\'s    software before restoring it on a different host \\/ server to avoid issues due to PHP version incompatibilities.<\\/p><h3>Changelog<\\/h3><h4>Bug fixes<\\/h4><ul>\\t<li>[HIGH] Large database records can cause an infinitely growing runaway backup or, if you\'re lucky, a backup crash due to exceeding PHP time limits.<\\/li>\\t<li>[HIGH] PHP Fatal Error if the row batch size leads to an amount of data that exceeds free PHP memory<\\/li>\\t<li>[HIGH] Resuming after error was broken when using the file storage for temporary files (default)<\\/li>\\t<li>[HIGH] WordPress multisite restoration: cannot log in if it\'s a directory-based multisite and you are restoring to the site\'s root<\\/li>\\t<li>[HIGH] WordPress multisite restoration: the path to the default site is not updated when restoring to a subdirectory making it impossible to access the site<\\/li>\\t<li>[HIGH] WordPress restoration: .htaccess RewriteRule has unnecessary path when restoring to a subdirectory, leading to routing issues.<\\/li>\\t<li>[LOW] FTP\\/SFTP over cURL uploads would fail if the remote directory couldn\'t be created<\\/li>\\t<li>[LOW] The Warnings pane was always displayed following resuming from a backup error<\\/li>\\t<li>[MEDIUM] Blank page if you delete all backup profiles from the database (a default backup profile could not be created in this case)<\\/li>\\t<li>[MEDIUM] Database hostname localhost:3306 leads to connection error under some circumstances. Note that this hostname is wrong: you should use localhost without a port instead!<\\/li>\\t<li>[MEDIUM] Database storage wouldn\'t report the lack of stored engine state, potentially causing forever stuck backups<\\/li>\\t<li>[MEDIUM] Errors always result in the resume pane being shown, no matter what your settings are<\\/li>\\t<li>[MEDIUM] Errors when reading the backup engine\'s state were not reported, causing the backup to seem like it runs forever<\\/li>\\t<li>[MEDIUM] Logic error leads to leftover temporary database dump files in the backup output directory under some circumstances<\\/li>\\t<li>[MEDIUM] WordPress restoration: .htaccess RewriteBase does not contain trailing forward slash when restoring to a subdirectory, may cause routing issues in some cases<\\/li><\\/ul>\",\"infourl\":\"https:\\/\\/www.akeebabackup.com\\/download\\/backupwp\\/2-2-0.html\",\"md5\":\"87ea33920284502b545b2c07fd98adaf\",\"sha1\":\"905337ffc52fbd3e07d4cfc9b7dd023baf35fd6a\",\"platforms\":\"php\\/5.3,php\\/5.4,php\\/5.5,php\\/5.6,php\\/7.0,php\\/7.1,wordpress\\/3.8+\"}'), ('liveupdate_lastcheck', '2017-06-21 07:15:09', '1498047309');
